#include "Music.h"
#include "ConstantDefinitions.h"

volatile uint8_t MUSIC_CHOICE = 1;
volatile uint16_t currentIndex = 0;
volatile uint8_t currentSection = 0;
volatile uint8_t interpolatePosition = 0;
volatile uint8_t diff = 0;
volatile uint8_t value = 0;
volatile uint8_t nextValue = 0;
volatile uint16_t nextIndex = 1;

void InitMusic(PIT_CHANNEL channel) 
{
	InitPIT(channel, MusicNextSignal);
}

void ChooseTrack(uint8_t choice)
{
	MUSIC_CHOICE = choice;
}

void MusicNextSignal(void)
{
	uint8_t temp = 0;
	switch (MUSIC_CHOICE) 
	{
		case 1:
			if (interpolatePosition == 0) 
			{
				nextIndex = currentIndex + 1;
				if (nextIndex == _MUSIC_SECTION_LENGTH1) nextIndex = 0;
				value = MUSIC_TRACK1[currentSection][currentIndex];
				nextValue = MUSIC_TRACK1[currentSection][nextIndex];
				diff = (nextValue - value) / MUSIC_INTERPOLATION_RATIO;
			}
			temp = value + diff * interpolatePosition;
			AnalogWritePin(MUSIC_PIN, (uint16_t)((value + diff * interpolatePosition) << 4));
			interpolatePosition++;
			if (interpolatePosition == MUSIC_INTERPOLATION_RATIO) 
			{
				currentIndex++;
				interpolatePosition = 0;
			}
			if (currentIndex == _MUSIC_SECTION_LENGTH1)
			{
				currentIndex = 0;
				currentSection++;
				if (currentSection == _MUSIC_TRACK1_SECTIONS) currentSection = 0;
			}
			break;
		case 2:
			value = MUSIC_TRACK2[currentSection][currentIndex];
			temp = value;
			AnalogWritePin(MUSIC_PIN, (uint16_t)(value << 4));
			currentIndex++;
			if (currentIndex == _MUSIC_SECTION_LENGTH2)
			{
				currentIndex = 0;
				currentSection++;
				if (currentSection == _MUSIC_TRACK2_SECTIONS) currentSection = 0;
			}
			break;
		case 3:
			value = MUSIC_TRACK3[currentSection][currentIndex];
			temp = value;
			AnalogWritePin(MUSIC_PIN, (uint16_t)(value << 4));
			currentIndex++;
			if (currentIndex == _MUSIC_SECTION_LENGTH3)
			{
				currentIndex = 0;
				currentSection++;
				if (currentSection == _MUSIC_TRACK3_SECTIONS) currentSection = 0;
			}
			break;
	}
	DigitalWritePin(ExternalDAC_Pins[0], temp & 0x01 ? HIGH : LOW);
	DigitalWritePin(ExternalDAC_Pins[1], temp & 0x02 ? HIGH : LOW);
	DigitalWritePin(ExternalDAC_Pins[2], temp & 0x04 ? HIGH : LOW);
	DigitalWritePin(ExternalDAC_Pins[3], temp & 0x08 ? HIGH : LOW);
	DigitalWritePin(ExternalDAC_Pins[4], temp & 0x10 ? HIGH : LOW);
	DigitalWritePin(ExternalDAC_Pins[5], temp & 0x20 ? HIGH : LOW);
	DigitalWritePin(ExternalDAC_Pins[6], temp & 0x40 ? HIGH : LOW);
	DigitalWritePin(ExternalDAC_Pins[7], temp & 0x80 ? HIGH : LOW);
}

